import './NestedMapping.css'
import UserList from './UserList'


const Users=[
  {
      name:"mh akash",
      university : "Atish Depankar University Of Science And Technology",
      phones :[
          {home:"019893"},{office:"558885"}
      ]
  },
  {
      name:"ria",
      university : "Atish Depankar University Of Science And Technology",
      phones :[
          {home:"01948593"},{office:"55585885"}
      ]
  },
  {
      name:"kamal",
      university : "Atish Depankar University Of Science And Technology",
      studentInfo :[
          {id:""},{section:"55386885"}
      ]
  }
]

function NestedMapping() {
  return (
 
    <div className='container'>
    {Users.map((user)=>{
      const {name,university} = user;
      return(
        <UserList name={name} university={university} />
      )
    })}
          
    </div>

         
     

  )
}

export default NestedMapping
